    [],nt"revision_timestamp": "2015-07-08T17:42:57.147162",nt"name": "series-information-file-for-the-2014-kml-cartographic-boundary-file-state-puma-1-500000",nt"isopen":
    false,nt"url": null,nt"notes": "The 2014 cartographic boundary KMLs are
    simplified representations of selected geographic areas from the U.S. Census Bureau's
    Master Address File / Topologically Integrated Geographic Encoding and Referencing
    (MAF/TIGER) Database (MTDB). These boundary files are specifically designed for
    small-scale thematic mapping. When possible, generalization is performed with the
    intent to maintain the hierarchical relationships among geographies and to maintain
    the alignment of geographies within a file set for a given year. Geographic areas
    may not align with the same areas from another year. Some geographies are available
    as nation-based files while others are available only as state-based files.nnAfter
    each decennial census, the Census Bureau delineates Public Use Microdata Areas (PUMAs)
    for the tabulation and dissemination of decennial census Public Use Microdata Sample
    (PUMS) data, American Community Survey (ACS) PUMS data, and ACS period estimates.
    Nesting within states, or equivalent entities, PUMAs cover the entirety of the United
    States, Puerto Rico, Guam, and the U.S. Virgin Islands. PUMA delineations are subject
    to population, building block geography, geographic nesting, and contiguity criteria.
    Each PUMA is identified by a 5-character numeric census code that may contain leading
    zeros and a descriptive name.",nt"license_title": null,nt"extras": [{ntt"key":
